    if remaining_cakes >= 0:
        price_of_cakes = remaining_cakes * price_of_cakes
    else:
        price_of_cakes = 0

    if price_of_cakes + price_of_doughnuts == number_of_doughnuts:
        return 'Yes'
    else:
