def solution(stdin: str) -> str:
    """
    This is a classic problem of finding the number of lines of code in a function, the solution is just a brute force.
    """
    n, m = [int(x) for x in stdin.split()]
    if n * m == 0:
        return "-1"
    row_lines = ["".join(["*" if i > n/2 else "." for i in range(1, m + 1)]) for j in range(n)]
    for i in range(n):
        for j in range(m):
            if row_lines[i][j] == "*":
                if j > n/2:
                    row_lines[i] = row_lines[i][:j] + "." + row_lines[i][j + 1:]
                if j < m - n/2:
                    row_lines[i] = row_lines[i][:j + 1] + "*" + row_lines[i][j + 1:]
    return str(sum([j.count("*") for j in row_lines]))

