    healths = [int(x) for x in stdin.split()]

    def win(healths, count):
        return not healths or max(healths) <= 0

    def attack(healths, count):
        for _ in range(count):
            if healths:
                healths.pop()
        return healths

    def special(healths, count):
        for _ in range(count):
            healths.pop()
        return healths

    if not healths:
        return '0'
    elif len(healths) == 1:
        return str(healths[0])
    else:
        healths = healths[::-1]
        count = 0
        while not win(healths, count):
            if count >= k:
                healths = special(healths, count - k)
            healths = attack(healths, 1)
            count += 1
        return str(count)

